}
const Home = () => {

    const MainSection = (props) => {
        return (
            <div className='main-section'>

                <h4 className="custom-font">เรื่องเล่าล่าสุด</h4>

                <Row>
                    <Col lg={8}>
                        Big card
                    </Col>
                    <Col lg={4}>
                        common card
                        <br/><br/><br/><br/><br/>
                        <p>dd</p>
                    </Col>
                </Row>
            </div>
        )
    }
    return (
        <div>
            <Navbar>
